/**
 * @file
 * JS to convert select lists into fancy buttons.
 */
(function ($) {

  $.fn.selectButtons = function (options) {
    var settings = $.extend({
      ajaxSubmitSelector: null,
      ajaxSubmitDelay: 300,
      // Wrapper for form elements, to hide.
      hideInputSelector: '.form-item:not(.form-item--select-button)',
      moreFilterText: Drupal.t('More filters'),
      multiplePrimary: false,
      primaryButtons: []
    }, options);
    this.selectButtons = new SelectButtons(this, settings, $);
    return this;
  };

})(jQuery);

// Constructor.
function SelectButtons(sourceEl, settings, $) {
  // The source element (exposed form).
  this.sourceEl = sourceEl;

  // The SelectButtons element.
  this.el = null;

  this.settings = settings;

  this.$ = $;

  this.primaryButtons = [];
  this.secondaryButtons = [];

  this.ajaxSubmitEl = null;
  this.ajaxTimeout = null;

  this.init();
}

// Initialize.
SelectButtons.prototype.init = function () {
  var s = this;

  var p = s.$('select', this.el).each(function () {
    // Remove trailing brackets, [].
    var name = this.name;
    if (name.slice(-2) === '[]') {
      name = name.slice(0, -2);
    }
    s.$('option', this).each(function () {
      if (s.isPrimaryOption(name, this.value)) {
        s.primaryButtons.push(this);
      }
      else {
        s.secondaryButtons.push(this);
      }
    });
  }).promise();
  Promise.resolve(p);

  this.primaryButtons = this.orderPrimaryButtons(this.primaryButtons);
  this.hideInputs().render();

  if (this.settings.ajaxSubmitSelector) {
    this.ajaxSubmitEl = this.$(this.settings.ajaxSubmitSelector).hide();
  }

  // this.$(window).resize(this.resize);

  return this.$(this.sourceEl).addClass('select-buttons--processed');
};

// Determines if an option is a primary option.
SelectButtons.prototype.isPrimaryOption = function (name, value) {
  for (var k in this.settings.primaryButtons) {
    if (this.settings.primaryButtons[k].name == name && this.settings.primaryButtons[k].option == value) {
      return true;
    }
  }
  return false;
};

// Puts primary buttons in order as defined in config.
SelectButtons.prototype.orderPrimaryButtons = function (buttons) {
  var result = [];

  var buttonsNested = {};
  for (var l in buttons) {
    var name = buttons[l].parentNode.name;
    if (name.slice(-2) === '[]') {
      name = name.slice(0, -2);
    }
    buttonsNested[name] = buttonsNested[name] || {};
    buttonsNested[name][buttons[l].value] = buttons[l];
  }

  for (var k in this.settings.primaryButtons) {
    buttonsNested[this.settings.primaryButtons[k].name] = buttonsNested[this.settings.primaryButtons[k].name] || {};
    if (buttonsNested[this.settings.primaryButtons[k].name][this.settings.primaryButtons[k].option] !== undefined) {
      result.push(buttonsNested[this.settings.primaryButtons[k].name][this.settings.primaryButtons[k].option]);
    }
  }

  return result;
};

// Hides inputs.
SelectButtons.prototype.hideInputs = function () {
  if (this.settings.hideInputSelector) {
    this.$(this.settings.hideInputSelector, this.sourceEl).hide();
  }
  return this;
};

// Renders the select buttons.
SelectButtons.prototype.render = function () {
  var s = this;
  var originalEl = s.$('.select-buttons', s.sourceEl);

  s.el = s.$("<div></div>")
    .addClass('select-buttons')
    .append(s.renderButtons(s.$("<div></div>")));

  Promise.resolve(s.el.promise());
  s.setStates();

  // @TODO: trigger events for attach/detach.
  if (originalEl.length < 1) {
    s.el.prependTo(this.sourceEl);
  }
  else {
    originalEl.replace(s.el);
  }

  return this;
};

// Renders the main buttons.
SelectButtons.prototype.renderButtons = function (wrapper) {
  var s = this;

  wrapper.addClass("buttons").addClass("buttons--inline");

  for (var k in s.primaryButtons) {
    var btn = s.$("<button>" + s.primaryButtons[k].innerHTML + "</button>")
      .addClass("button")
      .addClass("select-buttons--main-button")
      .attr('data-sbid', s.primaryButtons[k].parentNode.name + '--' + s.primaryButtons[k].value);
    s.$("<a href=\"#\"></a>")
      .addClass("select-buttons--main-link")
      .append(btn)
      .appendTo(wrapper)
      .click(function (event) {
        event.preventDefault();
        btn = s.$('button', this);
        if (s.settings.multiplePrimary) {
          // Just toggle active state.
          btn.toggleClass('active');
        }
        else {
          // Set this one as active.
          var btnEl = btn[0];
          for (var k in s.primaryButtons) {
            if (s.primaryButtons[k].sourceEl.dataset.sbid === btnEl.dataset.sbid) {
              s.$(s.primaryButtons[k].sourceEl).toggleClass('active');
            }
            else {
              s.$(s.primaryButtons[k].sourceEl).removeClass('active');
            }
          }
        }
        s.setValues();
      });
    s.primaryButtons[k].sourceEl = btn[0];
  }

  if (s.secondaryButtons.length > 0) {
    wrapper.append(s.renderMoreFilters(s.$('<div></div>')));
  }

  return wrapper;
};

// Renders the more filters drawer and toggle.
SelectButtons.prototype.renderMoreFilters = function (wrapper) {
  var s = this;

  wrapper.addClass('select-buttons--more');
  var moreBtn = s.$("<button>" + s.settings.moreFilterText + "</button>")
    .addClass("button");
  var drawerContainer = s.$('<div></div>')
    .addClass('select-buttons--drawer--container');
  var drawer = s.$('<div></div>')
    .addClass('select-buttons--drawer')
    .append(drawerContainer);
  s.$("<a href=\"#\"></a>")
    .append(moreBtn)
    .appendTo(wrapper).click(function (event) {
    event.preventDefault();
    wrapper.toggleClass('open');
    s.resize();
  });
  wrapper.append(drawer);

  for (var k in s.secondaryButtons) {
    var chk = s.$('<input type="checkbox">')
      .addClass('form-checkbox')
      .addClass('form-item__textfield');
    var label = s.$('<label></label>').html(s.secondaryButtons[k].innerHTML);
    var chkWrapper = s.$('<div></div>')
      .addClass('form-item')
      .addClass('form-item--checkbox')
      .addClass('form-item--select-button')
      .append(chk)
      .append('<span></span>')
      .append(label);
    drawerContainer.append(chkWrapper);
    chk.change(function () {
      s.setValues().setStates();
    });
    s.secondaryButtons[k].sourceEl = chk[0];
  }

  return wrapper;
};

// Sets states from select lists onto elements.
SelectButtons.prototype.setStates = function () {
  var s = this;

  // Set class on primary buttons.
  for (var k in s.primaryButtons) {
    s.$(s.primaryButtons[k].sourceEl).toggleClass('active', s.primaryButtons[k].selected);
  }

  var set = 0;
  for (k in s.secondaryButtons) {
    s.secondaryButtons[k].sourceEl.checked =  s.secondaryButtons[k].selected;
    if (s.secondaryButtons[k].selected) {
      set++;
    }
  }
  s.$('.select-buttons--more', s.el).toggleClass('active', set > 0);

  return s;
};

// Sets values onto select elements.
SelectButtons.prototype.setValues = function () {
  var s = this;

  for (var k in s.primaryButtons) {
    s.primaryButtons[k].selected = s.$(s.primaryButtons[k].sourceEl).hasClass('active');
  }

  for (var k in s.secondaryButtons) {
    s.secondaryButtons[k].selected = s.secondaryButtons[k].sourceEl.checked;
  }

  // AJAX submit.
  if (s.ajaxSubmitEl) {
    if (s.ajaxTimeout) {
      clearTimeout(s.ajaxTimeout);
      s.ajaxTimeout = null;
    }
    if (s.settings.ajaxSubmitDelay) {
      s.ajaxTimeout = setTimeout(function () {
        s.ajaxSubmitEl.click();
        s.ajaxTimeout = null;
      }, s.settings.ajaxSubmitDelay);
    }
    else {
      // Do it right away.
      s.ajaxSubmitEl.click();
    }
  }
  return this;
};

// React to resize, keep drawer visible.
SelectButtons.prototype.resize = function () {
  var $drawer = this.$('.select-buttons--drawer', this.el);
  var drawer = $drawer[0];

  // Small sizes, use default styles.
  if (window.innerWidth < 480) {
    $drawer.css('left', '');
    $drawer.css('max-width', '');
    return;
  }

  // Use "more" button as landmark.
  var more = this.$('.select-buttons--more', this.el)[0];

  // Figure out width and how much to adjust drawer's left position.
  var drawerWidth = drawer.offsetWidth + 30;
  var left = window.innerWidth - (more.getBoundingClientRect().left + drawerWidth);

  // Ensure there is enough width for drawer.
  if (left >= 0) {
    // If enough width, use values from styles.
    $drawer.css('left', '');
    $drawer.css('max-width', '');
  }
  else {
    // Else set drawer's left to push content left enough.
    $drawer.css('left', left);

    // Handle this small case where there's just not quite enough room.
    if (window.innerWidth < 510) {
      $drawer.css('max-width', window.innerWidth - more.getBoundingClientRect().left - 30);
    }
    else {
      $drawer.css('max-width', '');
    }
  }
};
