(function () {
  var modelCardElement, modelsListElement;

  var scrollToModel = function () {
    if (modelCardElement) {
      setTimeout(function () {
        modelCardElement.scrollIntoView(true);
      }, 500);
    }
  };

  var scrollToList = function () {
    if (modelsListElement) {
      modelsListElement.scrollIntoView(true);
    }
  };

  var displayShowMoreButton = function () {
    var modelCardBodyElement = modelCardElement.querySelector('.card__body');
    var showMoreButton = modelCardBodyElement.querySelector('.button--show-more');
    if (modelCardBodyElement && !showMoreButton) {
      var button = document.createElement('button');
      var buttonText = document.createTextNode('Show More');
      button.appendChild(buttonText);
      button.classList.add('button', 'button--chunky', 'button--dark', 'buttons', 'buttons--inline', 'button--show-more');
      button.addEventListener('click', scrollToList);
      modelCardBodyElement.appendChild(button);
    }
  };

  var checkXRAvailability = function () {
    navigator.xr.isSessionSupported('immersive-vr')
      .then((isSupported) => {
        if (isSupported) {
          scrollToModel();
          displayShowMoreButton();
        }
      });
  };

  var init = function () {
    modelCardElement = document.querySelector('.media-type-gallery_project.card--featured-content');
    modelsListElement = document.querySelector('.list--grid.view-gallery-projects.view-id-gallery_projects');

    if ("xr" in window.navigator) {
      checkXRAvailability();

      navigator.xr.addEventListener("devicechange", function () {
        checkXRAvailability();
      });
    }
  };

  window.addEventListener("load", init);

  init();
})();
