(function (Drupal, cookies) {
  // @TODO: Load JS files list from module settings.
  var libs = [
    { id: 'qualified', url: '/themes/custom/matterport/src/js/qualified.js', customCategory: 'functionality' },
    { id: 'qualified-external', url: 'https://js.qualified.com/qualified.js?token=oerwbSnkKEjaiD3g', customCategory: 'functionality' },
    { id: 'marketo', url: '/themes/custom/matterport/src/js/marketo.js', customCategory: 'targeting' },
    { id: 'segment', url: '/themes/custom/matterport/src/js/segment.js', category: 'strictlyNecessary' },
    { id: 'aapl-campaign-tracking', url: '/themes/custom/matterport/src/js/aapl-campaign-tracking.js', customCategory: 'targeting' },
    { id: 'migrate-utm', url: '/themes/custom/matterport/src/js/migrate-utm.js', customCategory: 'performance' },
  ];
  Drupal.behaviors.mattCookieConsent = {
    attach: function () {
      init();
    }
  };

  function loadJS(id, url) {
    var script = document.createElement('script');
    script.src = url;
    script.id = id;
    document.body.appendChild(script);
  }

  function checkCookieConsent() {
    var cookieConsentCookie = cookies.get('cookie_consent_v3');
    var isAnonymousUser = !document.getElementById('toolbar-administration');

    if (cookieConsentCookie && cookieConsentCookie !== '' && cookieConsentCookie !== null) {
      try {
        var cookieConsent = JSON.parse(unescape(cookieConsentCookie));

        if (isAnonymousUser) {
          libs.forEach(function (lib) {
            if ((lib.category && cookieConsent[lib.category])
              || (lib.customCategory && cookieConsent.custom && cookieConsent.custom[lib.customCategory])) {
              loadJS(lib.id, lib.url);
            }
          });
        }
      } catch (e) {
        anonLoad();
      } 
    } else if (isAnonymousUser) {
        anonLoad();
    }
  }

  function anonLoad() {
    var SEGMENT = 'segment';
    libs.forEach(function (lib) {
      if (lib.id == SEGMENT) {
        loadJS(lib.id, lib.url);
       }
    });
  }

  function init() {
    checkCookieConsent();
    document.addEventListener('cookie-consent.changed', function () {
      setTimeout(checkCookieConsent, 500);
    });
  }
})(Drupal, window.Cookies);
